#include <iostream>
using namespace std;

void remove_repeat(int *a, int l)
{
    int i, j, k;

    for (i = 0; i < l; i++)
    {
        for (j = i + 1; j < l; j++)
        {
            if (a[j] == a[i])
            {
                for (k = j + 1; k < l; k++)
                    a[k - 1] = a[k];
                l--;
            }
        }
    }

    for (i = 0; i < l; i++)
        cout << a[i] << endl;
}

#define MAX_VALUE 100

void deletere(int *a, int N)
{
    int count = 0;
    int b[MAX_VALUE] = {0};
    int i, j;
    bool flag;
    static int k = 0;
    for (i = 0; i < N; i++){
        flag = false;
        
        for(j = 0; j < k; j++){
            if(++count && a[i] == b[j]){
                flag = true;
                break;
            }
        }

        if(!flag)
            b[k++] = a[i];
    }
        
    for (i = 0; i < k; i++)
        cout << b[i] << " ";
    cout << endl;
    cout <<"次数："<<count;
}

